__NUXT_JSONP__("/cestovatelsky-slovnik/black-cap", (function(a,b){return {data:[{travelDictionary:[{id:1,slug:"black-cap",created_at:"2023-06-14T21:26:10.880033+00:00",name:"Black Cap",description:"\u003Cp\u003EBlack Cap v kontextu londýnských taxi se vztahuje k typickým londýnským taxíkům, které jsou také známé jako \"black cabs\" (černá taxíka). Tyto taxíky mají charakteristický design s ikonickou černou karoserií a mají speciální licenci pro provozování taxislužby v Londýně.\u003C\u002Fp\u003E\n\u003Cp\u003ELondýnské black cabs jsou známé pro svou prostornost, pohodlí a schopnost přepravit až pět pasažérů. Tyto taxíky jsou často využívány jak místními obyvateli, tak i turisty k přepravě po Londýně. Mají také speciální vlastnosti, jako je velký prostor pro zavazadla, výkonný motor, schopnost otáčet se na úzkých ulicích a speciální licenci pro přepravu osob se zvláštními potřebami.\u003C\u002Fp\u003E\n\u003Cp\u003ETermín \"Black Cap\" v souvislosti s londýnskými taxíky se obvykle používá pro odkaz na tyto ikonické černé taxíky a jejich charakteristický vzhled.\u003C\u002Fp\u003E",id_image_cover:b,id_image_hero:b,seo_tags:[{tag:"Taxi"}]}],imageTravelDictionary:[]}],fetch:{"OrganismsoSidebarListTravelDictionaryComponent:0":{travelDictionaries:[{id:14,id_image_cover:a,slug:"kosmopolitni",name:"Kosmopolitní"},{id:13,id_image_cover:a,slug:"kontinentalni-snidane",name:"Kontinentální snídaně"},{id:12,id_image_cover:a,slug:"boarding-time",name:"Boarding time"},{id:11,id_image_cover:a,slug:"boarding",name:"Boarding"},{id:10,id_image_cover:a,slug:"hop-on-hop-off",name:"hop-on, hop-off"}],images:[],isLoading:false}},mutations:void 0}}(null,0)));